import React from "react";
import useGitProjectCalculator from "../../container/gitprojects/gitProjectCalculator";
//
import GitProject from "./GitProject";
import { First } from "react-bootstrap/PageItem";
const LangGenerator: React.SFC = () => {
  const { gitLangFreq, gitLangs, isLoading } = useGitProjectCalculator();

  if (isLoading) {
    return <p>Loading</p>;
  }

  console.log(gitLangFreq);

  const keys = (obj: Object) => {
    for (const key in obj) {
      if (obj.hasOwnProperty(key)) {
        let value = obj[key];
      }
    }
    console.log(value);
  };
  return (
    <React.Fragment>
      {/* {Object.entries(gitLangFreq).forEach(([key, value]) => {
        return <GitProject language={key} ammount={value} />;
      })} */}
      {keys(gitLangFreq)}
    </React.Fragment>
  );
};

export default LangGenerator;
